;----------------------------------------------------------------------------
;Palette Pointers
;
;This structure	defines	the palette to use for each level. One entry per level.
;
;0x00 -	0x04: Pointer to palette
;0x04 -	0x06: Location in ram to load palette into
;0x06 -	0x08: Size of palette in (bytes	/ 4)
;----------------------------------------------------------------------------
PalPoint:	
		dc.l PalSega
		dc.w $FB00
		dc.w $80/4-1
		dc.l PalTitle
		dc.w $FB00
		dc.w $80/4-1
		dc.l PalLevelSelect
		dc.w $FB00
		dc.w $80/4-1
