		dc.w $60/4-1
		dc.l PalLz
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalMz
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalSlz
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalSyz
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalSbz
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalSs
		dc.w $FB00
		dc.w $80/4-1
		dc.l PalLz_U
		dc.w $FB00
		dc.w $80/4-1
		dc.l PalSbz3
		dc.w $FB00+$20
		dc.w $60/4-1
		dc.l PalSbz3_U
		dc.w $FB00
		dc.w $80/4-1
		dc.l PalFz
